import React from "react";

const inputType = ({labelText, labelFor, inputType, value, onChange,name,}) => {
  return (
    <>
      <div className="mb-2">
        <label htmlFor={labelFor} className="form-label">
          {labelText}
        </label>
        <input
          type={inputType}
          className="form-control"
          name={name}
          value={value}
          onChange={onChange}
        />
      </div>
    </>
  );
};

export default inputType;
